// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "@openzeppelin/contracts/proxy/Clones.sol";
import "./interface/ISavingsPool.sol";

contract SavingsPoolFactory {

    event SavingsPoolCreated(address pool);

    address public poolToken;
    address public tokenCompound;
    address public poolImplementation;

    address[] public registry;
    mapping(address=>address[]) private _userPools;

    constructor(address poolToken_, address tokenCompound_, address poolImplementation_) {
        poolToken = poolToken_;
        tokenCompound = tokenCompound_;
        poolImplementation = poolImplementation_;
    }

    function createPool() external {
        address pool = Clones.clone(poolImplementation);
        ISavingsPool(pool).initialize(msg.sender, poolToken, tokenCompound);
        registry.push(pool);
        _userPools[msg.sender].push(pool);
        emit SavingsPoolCreated(pool);
    }

    function registryLength() external view returns (uint256) {
        return registry.length;
    }

    function userPoolsLength(address beneficiary) external view returns (uint256) {
        return _userPools[beneficiary].length;
    }

    function userPool(address beneficiary, uint256 index) external view returns (address) {
        return _userPools[beneficiary][index];
    }

    function participate(address pool, uint256 amount) external {
        ISavingsPool(pool).participate(msg.sender, amount);
    }

    function claim(address pool) external {
        ISavingsPool(pool).claim(msg.sender);
    }
}
